import React from 'react'
import { Button } from '@material-ui/core';
import { useHistory  } from "react-router-dom";
import '../home.css';

function homebtns(props) {
	
  
  return (
    <div>
	    <a href="/login"> <Button className="button_style" variant="contained" color="primary" size="small"    >Login</Button></a>
	     <Button  className="button_style"  variant="contained"color="primary"size="small" >Register</Button>
	    </div>
  )
}

export default homebtns
